- Name: Azure.Storage.DataMovement.Blobs
  Version: 12.2.0-beta.1
  DisplayName: Data Movement - Blobs
  ServiceName: Storage
  VersionType: Beta
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-net/tree/Azure.Storage.DataMovement.Blobs_12.2.0-beta.1/sdk/storage/Azure.Storage.DataMovement.Blobs/CHANGELOG.md
  ChangelogContent: |-
    #### Features Added
    - Explicitly setting `BlobStorageResourceOptions.AccessTier` to `null` will disable preserving the access tier value from the source blob to the destination blob.

    #### Bugs Fixed
    - Fixed bug where AccessTier for Premium Page Blobs were not being preserved.
    - Fixed some issues when transferring virtual directories with Blob Storage as the source.
- Name: Azure.Storage.DataMovement
  Version: 12.2.0-beta.1
  DisplayName: Data Movement
